import React from 'react'
import {useState} from 'react'

function Item() {

const [rating,setRating ] = useState("defecto")

function handleClick(){
    setRating(10)
}

  return (
    <>
    <div className='item'>
        {rating}
    </div>
    <button onClick={handleClick}></button>
    </>
  )
}

export default Item
